import React from 'react'
import Sidebar from '../../Components/Sidebar/Sidebar';
import HealthTips from '../../Components/HealthTips.js/HealthTips';
import './Profile.css'

const Profile = () => {
    return (
        <>
            <Sidebar />
            <div className="home-section">
                <div className="text"><HealthTips /></div>
            </div>
        </>
    )
}

export default Profile;
